/*
The user is shown a cross momentarily, and is then shown a ring of Gabor patches momentarily. The user is then shown a ring of numbers
and a patch from the ring is picked at random and is shown to the user. The user has to quickly match the number to the patch in the middle.


To add/remove Gabor patches to the dataset, you may add/remove lines to the array shown below

*/
var base64ImgArray = ['data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,',
'data:image/png;base64,'];

var ring;
var currentTrial = 0; //Current Trial being played
var numTrials = 3; //total number of the trials
var gameMode = false;
var numImages = 6;

var screenW = window.innerWidth;    // Screen Width
var screenH = window.innerHeight;   // Screen Height
var thecanvas;

// Instruction Text
var instructions;

var img = [];
var positions = [];
var xcords = [];
var ycords = [];
var patches = [];
var isRandomOn = false;
var randImg = 0;
var sizeOfImage;
var isLoaded = false;
var npatch = 0;
var correctImg;
var circles = [];
var startTime;
var this_ms =0;
var rings = [];
var waitingForEnter = true;

function preload(){
    for(var i=0; i< 10; ++i){
        img[i] = loadImage(base64ImgArray[i]);
    }   
}

function setup() {
    thecanvas = createCanvas(screenW,screenH);
    clearScreen();
    ring = select('#ring');
    instructions = select('#instructions');
}

var offsetTop = 75;
var isTrue = false;
var clicked = false;

function mouseClicked(){
    if(clicked === false){
        for(var i = 0; i<circles.length; i++){
            if(((width/2-circles[i].x+circles[i].offset-circles[i].radius/2 < mouseX) && (mouseX < width/2-circles[i].x+circles[i].offset+circles[i].radius/2)) && ((height/2-circles[i].y-circles[i].offset-circles[i].radius/2 < mouseY) && (height/2-circles[i].y-circles[i].offset+circles[i].radius/2 > mouseY))){
                if(i === randImg){
                    fill(0,128,0);
                    ellipse(width/2-circles[i].x+circles[i].offset, height/2-circles[i].y-circles[i].offset, circles[i].radius, circles[i].radius);
                  	randomiseImages(numImages);
                    clicked = true;   
                }
    else{
        fill(128,0,0);
        ellipse(width/2-circles[i].x+circles[i].offset, height/2-circles[i].y-circles[i].offset, circles[i].radius, circles[i].radius);
        fill(0,128,0);
        ellipse(width/2-circles[randImg].x+circles[randImg].offset, height/2-circles[randImg].y-circles[randImg].offset, circles[randImg].radius, circles[randImg].radius);
        randomiseImages(numImages);        
        clicked = true;
      
    }
        }
        }   
    }
}

function showInstruction(_text){
	instructions.show();
	var pText = "<p>" + _text + "</p>";
  instructions.html(pText, false);
}

function keyPressed() {

    if (keyCode === ENTER && gameMode === false) {
          instructions.hide();
          instructions.attribute("align", "center"); 
          gameMode = true;
          startTime = millis();
        }
      } 

function draw() {
    if (gameMode === false){
        clearScreen();
    }
        if(currentTrial > numTrials){
            gameMode = false;
            clearScreen();
            instructions.hide();
            showInstruction("Game Over. Please don't turn of the window yet.");
        }
        if(gameMode === true){
            this_ms = millis()-startTime;
            instructions.hide();
      
            if(this_ms < 500){
                randomiseImages(numImages);
		    	ring= new Ring(width/2, height/2,6,180,175);
            }
            else if (this_ms < 1000){
                drawFixationCross(20);    
            }
        
            else if (this_ms > 1000 && this_ms <=2000){
                ring.show();
            }
        
            else if(this_ms > 2000 && this_ms <= 3000){
                clearScreen();
                drawFixationCross(20);

            }
            else if(this_ms > 3000 && this_ms <= 4000){
                clearScreen();
            }

            else if(this_ms > 4000 && this_ms < 6000){
                pickRandomImage();
                isRandomOn = true; 
                for(var i =0; i<npatch; i++){ 
                    circles.push(new Circles(i));
                }
                for(var k=0; k<npatch; k++){
                    circles[k].show();
                }  
                showPositions(xcords,ycords,npatch);

                for(var j=0; j<npatch; j++){
                    circles[j].changeColor();
                }
                showPositions(xcords,ycords, npatch);
                instructions.hide();
                 	
            }

            else if(this_ms > 6000 && this_ms < 8000){
                showInstruction("You have to be quick to pick!");
                showPositions(xcords,ycords, npatch);
                clicked = false;
            }        
            else if(this_ms > 8000){
                showInstruction("Click on the Green Circle to move to the next trial");
                if(clicked == true){
                circles = [];
			    randomiseImages(numImages);
			    isRandomOn = false;
			    clearScreen();
                this_ms = 0;
                startTime = millis();
                currentTrial++;
                
						
            }
        }
    }
}
var offset = 10; //size divided by 2

function drawFixationCross(size){
    stroke(0);
    strokeWeight(6);
    push();
    translate(width/2+offset,height/2+offset);
    line(-size,0,size,0);
    line(0,-size,0,size);
    pop();
}

function Ring (x,y,n,r, imgsize){
    this.x = x;
    this.y = y;
    this.n_patches = n;
    this.radius = r;
    this.size = imgsize;
    npatch = n;
    sizeOfImage = imgsize;

    var div = 360/this.n_patches; //get the angle of separation 

    for (var b = 0; b < this.n_patches; b++){
        xcords[b] = Math.cos((div*b) * (Math.PI / 180)) * this.radius;
        ycords[b] = Math.sin((div*b) * (Math.PI / 180)) * this.radius; 
    }
    var cross = 75;

    this.show = function(){
    for(var b =0; b < this.n_patches; b++){
        if (!isLoaded){
            image(patches[b],this.x-xcords[b]-cross,this.y-ycords[b]-cross,this.size, this.size);
        }
    }
    };
}

var checkrepeats = [];
var randint;

function randomiseImages(npatch){
    patches = [];
    checkrepeats = []; //stores values already loaded 
    for(var numpatch =0; numpatch < npatch; numpatch++){
        randint = Math.floor(Math.random() * 9 + 1); //generate random number from one to ten
        while(checkrepeats.includes(randint)){
            randint = Math.floor(Math.random() * 9 + 1); //keep generating random numbers if its already been generated
        }
        checkrepeats.push(randint); //store the number that was generated

        patches.push(img[randint]); //add the image corresponding to the index to the new array
    }
}

function pickRandomImage(){
    if(isRandomOn === false){
        randImg = Math.floor(Math.random()*npatch +1); //pick a random number from the npatch   
        image(patches[randImg], width/2-offsetTop,height/2-offsetTop, sizeOfImage, sizeOfImage);
    }
}

function clearScreen(){
    background(128,128,128);
}

function showPositions(xcords, ycords, npatch){
    fill(0);
    for(var i = 0; i<npatch; i++){
        textSize(40);
        strokeWeight(0);
        text(i,width/2-xcords[i],height/2-ycords[i]);
    }
}

function drawCircles(xcords, ycords, npatch){
    fill(220);
    for(var i = 0; i<npatch; i++){      
        circles[i] = ellipse(width/2-xcords[i]+15,height/2-ycords[i]-15, 80,80);
    }
}

function Circles(i){

    this.x = xcords[i];
    this.y = ycords[i];
    this.radius = 80;
    this.offset = 15;

this.show = function(){
    fill(220);
    ellipse(width/2-this.x+this.offset, height/2-this.y-this.offset, this.radius, this.radius);
};

this.changeColor = function(){
    if(((width/2-this.x+this.offset-this.radius/2 < mouseX) && (mouseX < width/2-this.x+this.offset+this.radius/2)) && ((height/2-this.y-this.offset-this.radius/2 < mouseY) && (height/2-this.y-this.offset+this.radius/2 > mouseY))){
        fill(240);
        ellipse(width/2-this.x+this.offset, height/2-this.y-this.offset, this.radius, this.radius);
        showPositions();
    }
    };
}






